import '../Styles/App.css';
import { Routes, Router, Route, Navigate } from "react-router-dom"
import Navbar from './Navbar';
import Holder from './Holder';
import Home from './Home';
import Team from './Team';

function App() {
  return (
    <div>
      <Router>
        <Navbar/>
        <Routes>
          <Route path='/' exact render={() => <Navigate to='/home'/>} />
          <Route path='/home'>
            <Home/>
          </Route>
          <Route path='/team'>
            <Team/>
          </Route>
          <Route path='/paint'>
            <Holder/>
          </Route>
        </Routes>
      </Router>
    </div>
  );
}

export default App;
